import {Settlement} from "../types";

export function findYaCode(stationName: string, allStations: Settlement[]) {
	console.log({stationName});
	if (stationName !== undefined) {
		return allStations.find((obj: any) => obj.title === stationName)?.stations
			.find((obj: any) => obj.direction)?.codes.yandex_code
	}
}
